import React, {Component} from 'react'
import {Link} from 'react-router-dom'
import { register } from '../../serviceWorker';

class Navbar extends Component{
    state = {
        isLoggedIn: false,
    }
    onActive = () => {
        return this.props.setActivePath("/register");
    }
    render(){
        return(
            <div className="App">
                    <hr/>
                        <h2 style={navTextStyling}>News Products Login <Link style={this.onActive} className="registerLink" to="/register">Register</Link></h2>
                    <hr/>            
            </div>
        )
    }
}

const navTextStyling = {
    wordSpacing: "100px",
    fontSize: "12px"
}

export default Navbar;
